//base64字符串转化成图片
    public static void GenerateImage(String imgStr) throws Exception {
        System.out.print("已经收到了把字节码转化为图片的方法");
        //对字节数组字符串进行Base64解码并生成图片
        if (imgStr == null) //图像数据为空
            return;
        //Base64解码
        byte[] b = Base64Utils.decodeFromString(imgStr);
        for (int i = 0; i < b.length; ++i) {
            if (b[i] < 0) {//调整异常数据
                b[i] += 256;
            }
        }
        //生成jpeg图片
        String imgFilePath = "I:\\alankin\\songProject\\db\\qrCode.jpg";//新生成的图片
        OutputStream out = new FileOutputStream(imgFilePath);
        out.write(b);
        out.flush();
        out.close();
    }
